define('common/components/catlist/catlistController',[
    'underscore',
    'backbone', 
    'jquery',
    'coreUtils',
    'Application',
    '_base/BaseController',
    'settings',
    'common/components/catlist/views/catlistView'
], function (
    _,
    Backbone,
    $,
    CoreUtils,
    Application,
    BaseController,
    Settings,
    catlistView
) {
    var catlistController = function() {
        
        BaseController.call(this);

        this._view = new catlistView();
        
        this._init();
        this._bindEvents();
    };
    
    catlistController.prototype = Object.create(BaseController.prototype);
    
    catlistController.prototype._bindEvents = function() {
        this._view.on('render', this._onViewRendered.bind(this));
        Application.on('category:setactive', this._setActiveCategory.bind(this));
    };
    
    catlistController.prototype._init = function() {
    };
    
    catlistController.prototype._onViewRendered = function() {
        this.setComponentRendered(true);
    };

    catlistController.prototype._setActiveCategory = function() {
        var params = CoreUtils.getURIParams();
        var rootParam = params[0] || 'main';
        var secParam  = params[1] || 0;
        var view = this.getView();
        view.$('.category-list-item').removeClass('active');
        if (rootParam === 'category') {
            $.each(view.$('.catlist-item'), function(key, item){
                var current = $(item);
                var href = current.attr('href');
                var hrefArray = href.split('/');
                var curCatId = hrefArray[2] || 0;
                if (curCatId === secParam) {
                    current.parent().addClass('active');
                    return false;
                }
            });
        }
    };

    catlistController.prototype.renderView = function() {
        this.getView().render();
    };
    
    catlistController.prototype.showCategoryList = function() {
        if (!this.isComponentRendered()) {
            var view = this.getView();
            var mainLayout = Application.getMainLayout();
            mainLayout.getView().showChildView('leftRegion', view);
        }
        Application.trigger('category:setactive');
    };

    return catlistController;
});


define('_base/BaseModule',[
    'underscore',
    'backbone', 
    'jquery',
    'Application',
    'coreUtils',
    './BaseController'
], function (
    _,
    Backbone,
    $,
    Application,
    CoreUtils,
    BaseController
) {
    var BaseModule = function() {

        BaseController.call(this);

        this._view = null;
        this._isAdded = false;
        this._isGlobalLoading = false;
        this._pageMeta = {};
    };
    
    BaseModule.prototype = Object.create(BaseController.prototype);

    BaseModule.prototype.__renderContent = function() {
        var isCurrentModule = CoreUtils.isCurrentModule(this._moduleCode);
        
        // hide all content regions
        isCurrentModule && Application.trigger('content:regions:hide');
        
        // pagetitle widget render
        var title = this._pageMeta.pageTitle;
        var code = this._pageMeta.pageCode;
        isCurrentModule && Application.trigger('pagetitle:render', title, code);
        
        // show current module region
        isCurrentModule && Application.trigger('content:region:show', this._regionName);
        
        // show current module breadcrumbs
        isCurrentModule && Application.trigger('breadcrumbs:show', this._breadCrumbs);
        
        // change title html tag
        isCurrentModule && Application.trigger('title:change', this._pageTitle);
    };
    
    BaseModule.prototype.__renderSpinner = function() {
        var isCurrentModule = CoreUtils.isCurrentModule(this._moduleCode);
        
        // pagetitle widget render
        isCurrentModule && Application.trigger('pagetitle:render', '', '');
        
        // hide breadcrumbs to show spinner
        isCurrentModule && Application.trigger('breadcrumbs:hide');
        
        // hide all content regions to show spinner
        isCurrentModule && Application.trigger('content:regions:hide');
        
        // show spinner
        isCurrentModule && Application.trigger('spinner:large:show', 'Идет загрузка данных...');
        
        // change title html tag to "loading" title
        isCurrentModule && Application.trigger('title:change', 'Идет загрузка данных...');
    };
    
    BaseModule.prototype.__showGlobalError = function(psMessage) {
        Application.trigger('content:regions:hide');
        Application.trigger('error:modal:show', psMessage);
    };
    
    return BaseModule;
});

